package org.apache.commons.configuration2;

import org.apache.commons.configuration2.ex.ConfigurationException;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;

import java.io.StringReader;
import java.nio.file.Path;
import java.util.Arrays;
import java.util.List;

import static org.junit.jupiter.api.Assertions.assertEquals;

/**
 * Tests for YAMLConfiguration.
 */
public class YAMLConfigurationTest {

    @TempDir
    private Path tempDir;

    private final String yamlContent = "key1: value1\n" +
            "key2: value2\n" +
            "key3:\n" +
            "  - item1\n" +
            "  - item2\n" +
            "key4: true\n" +
            "key5:\n" +
            "  example:\n" +
            "    - \"\"\n" +
            "    - \"\"\n" +
            "    - \"value3\"";

    private YAMLConfiguration config;

    @BeforeEach
    public void setUp() throws ConfigurationException {
        config = new YAMLConfiguration();
        config.read(new StringReader(yamlContent));
    }

    @Test
    public void testGetPropertyWithEmptyStringValuesInList() {
        final Object property = config.getProperty("key5.example");
        final List<String> expected = Arrays.asList("", "", "value3");
        assertEquals(expected, property);
    }
}

package org.apache.commons.configuration2;

import static org.junit.jupiter.api.Assertions.assertEquals;

import java.io.File;
import java.io.FileWriter;
import java.io.IOException;
import java.io.Writer;
import java.util.Arrays;
import java.util.List;

import org.apache.commons.configuration2.builder.fluent.Configurations;
import org.apache.commons.configuration2.ex.ConfigurationException;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;

/**
 * Test class to validate hierarchical settings with multiple empty text entries.
 */
public class TestHierarchicalConfigurationWithBlanks {

    @TempDir
    File tempFolder;

    @Test
    public void testMultipleEmptyValuesArePreserved() throws IOException, ConfigurationException {
        final String xml =
            "<configuration>" +
            "  <key5>" +
            "    <example/>" +
            "    <example/>" +
            "    <example>value</example>" +
            "  </key5>" +
            "</configuration>";

        final File testFile = new File(tempFolder, "test.xml");
        try (Writer writer = new FileWriter(testFile)) {
            writer.write(xml);
        }

        final Configurations configs = new Configurations();
        final Configuration config = configs.xml(testFile);

        final List<String> values = config.getList(String.class, "key5.example");

        assertEquals(Arrays.asList("", "", "value"), values);
    }
}

package org.apache.commons.configuration2;

import static org.junit.jupiter.api.Assertions.assertEquals;

import java.io.File;
import java.io.FileReader;
import java.io.FileWriter;
import java.util.Arrays;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.io.TempDir;

public class YAMLConfigurationReadsListWithEmptyStringsTest {

    @TempDir
    public File tempFolder;

    private final String testYaml = "key5:\n  example:\n    - \"\"\n    - \"\"\n    - \"value\"";

    private YAMLConfiguration yamlConfiguration;

    @BeforeEach
    void setUp() throws Exception {
        File yamlFile = new File(tempFolder, "test.yaml");
        try (FileWriter writer = new FileWriter(yamlFile)) {
            writer.write(testYaml);
        }

        yamlConfiguration = new YAMLConfiguration();
        yamlConfiguration.read(new FileReader(yamlFile));
    }

    @Test
    void testGetProperty() {
        final Object property = yamlConfiguration.getProperty("key5.example");
        assertEquals(Arrays.asList("", "", "value"), property);
    }
}
